import React from "react";

import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";

import { Navigation, Pagination, Mousewheel, Keyboard } from "swiper";

import  Image1  from "./Al.jpg";
import  Image2  from "./Certificate_page-0001.jpg";
import  Image3  from "./LIBREOFFICE_SUITE CALC_pdf_page-0001.jpg";
import  Image4  from "./data analysis_page-0001.jpg";
import  Image5  from "./java_training_page-0001.jpg";
import  Image6  from "./machine-learning-30-day-s_page-0001.jpg";
import  Image7  from "./python-10-days_page-0001.jpg";
import  Image8  from "./sql_page-0001.jpg";
import  Image9  from "./Python.png";
import  Image10  from "./Python_bag.png";

const Certificate =()=>{
    return (
        <div className="Slider" id="H1-Certificate">
          <h1 className="H1-Certificate">Certificate</h1>
          <div className="slider-center">
          <Swiper
        cssMode={true}
        navigation={true}
        pagination={true}
        mousewheel={true}
        keyboard={true}
        modules={[Navigation, Pagination, Mousewheel, Keyboard]}
        className="mySwiper"
      >
        <SwiperSlide><img src={Image1} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image2} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image3} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image4} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image5} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image6} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image7} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image8} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image9} alt="An example image" /></SwiperSlide>
        <SwiperSlide><img src={Image10} alt="An example image" /></SwiperSlide>
        
      </Swiper>
          </div>
        </div>
    )
}

export default Certificate
